import React from 'react';
import { Card, Col, Row } from 'antd';
import "./styling/app.css"
import { Link } from "react-router-dom";
import Quiz from './Optionso/quiz';

class First extends React.Component{
  constructor(){
    super()
    this
  }
  render(){
  return(
 <div> 
   <div className="container" style={{ background: '#ECECEC', padding: '20px', alignContent: 'center', opacity: 1.2}}>
 <Row gutter={16} >
   <Col className='img1' span={8}>
     <Card  bordered={false}><Quiz/></Card>
   </Col>

   <Col className='img3' span={8}>
     <Card title="Take Away The Excuse" bordered={false}>Card content</Card>
   </Col>
 </Row>


</div> 
<div  style={{position:'fixed', right:0, bottom:0}}>
   <Row>
   <h1>Willing To Cont.</h1>
 <Link style={{display: 'inline-block'}} to="/third">Second</Link>
 </Row>
 </div>
</div>

  );
}
}

export default First;
